import React from "react";
import { Container } from "react-bootstrap";
import Product from "./Product";

function SectionHeader() {
  return (
    <Container className="text-center my-4">
      <h6>INFANTS</h6>
      <hr className="w-90 mx-auto text-dark" />
    </Container>
  );
}

function ProductBox() {
  return (
    <Container>
      {/* Section Header */}
      <SectionHeader />

      {/* Product List */}
      <Container className="my-4 d-flex flex-row justify-content-evenly">
        <div className="d-flex flex-column align-items-center">
          <Product img='' oldprice='' product_name='' newprice='' discount='' />
        </div>
        <div className="d-flex flex-column align-items-center">
          <Product />
        </div>
        <div className="d-flex flex-column align-items-center">
          <Product />
        </div>
        <div className="d-flex flex-column align-items-center">
          <Product />
        </div>
      </Container>
    </Container>
  );
}

export default ProductBox;
